import React, { useState,useEffect } from "react";
import { Container, Grid , Button, Typography  ,FormControl,Select,MenuItem} from "@material-ui/core";
import { DataGrid } from '@material-ui/data-grid';
import ModalBranch from "./components/modalBranch";
import { getLines } from "../../services/api/ConfigService";

const BranchConfig =()=>{
const [ lines, setLines] = useState([]);

useEffect(() => {
    getLines().then(response =>{
        setLines(response.data);
    });
}, [true])

    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        { field: 'firstName', headerName: 'Descripción', width: 250},
        { field: 'edit', headerName: 'Editar', width: 160,
            renderCell: (params) => (
                <strong>
                    <Button
                        variant="contained"
                        size="small"
                        color="secondary"
                        style={{ marginLeft: 16 }}
                        onClick={''}

                    >
                        Editar
                  </Button>
                </strong>
            ),
        },
        { field: 'detail', headerName: 'Detalle', width: 160,
        renderCell: (params) => (
            <strong>
                <Button
                    variant="contained"
                    size="small"
                    color="secondary"
                    style={{ marginLeft: 16 }}
                    onClick={''}

                >
                    Detalle
              </Button>
            </strong>
        ),
    },
      ];

      const rows = [
        { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
        { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
        { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
        { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
        { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
        { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
        { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
        { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
        { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
      ];

      const [ openLine, setOpenLine ] = useState(false);
      const handleOpenLine =()=>{
        setOpenLine(!openLine);
      }

      const onclickbutton =()=>{
        handleOpenLine();
      }

    return(
        <Container maxWidth>
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <Typography variant={'h5'}> Marcas</Typography>
                </Grid>
                <Grid item xs={8}>
                <FormControl fullWidth variant="outlined"  > 
                    <Select 
                        fullWidth
                        label="Linea"
                        name="LineId"
                        >
                        <MenuItem value="0">
                            <em>Seleccione</em>
                        </MenuItem>
                        {(lines.map((n) => 
                          <MenuItem value={n.id}>{n.name}</MenuItem>
                        ))}
                      </Select>

                    </FormControl>

                </Grid>
                <Grid item xs={2}>
                    <Button  fullWidth variant="contained">Buscar</Button>
                </Grid>
                <Grid item xs={2}>
                    <Button onClick={onclickbutton} fullWidth variant="contained">Nuevo</Button>
                    <ModalBranch isOpen={openLine} handleClose={handleOpenLine} />
                </Grid>
                <Grid item xs={12}>
                <div style={{ height: 400, width: '100%' }}>
                    <DataGrid
                        rows={rows}
                        columns={columns}
                        pageSize={5}
                        disableSelectionOnClick
                    />
                    </div>
                  </Grid>
            </Grid>
        </Container>
    );
}

export default BranchConfig;
